import React from 'react';
import DemoLinks from './DemoLinks';
import './App.css';

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <h6>How To Demo.Me</h6>
      </header>
      <DemoLinks />
    </div>
  );
}

export default App;
